    render() {
        const { name, type, averageWeight, image } = this.props;
        return (
            <div className="pokeCard">
            <div>{`${name}`}</div>
            <div>{`${type}`}</div>
            <div>{`${averageWeight.averageWeight}`}</div>
                <image src={image} alt={name}/>
            </div>
        ) 
    }
}
